import React from 'react';
import { Container } from './styles';
import { Input,  KeyboardDatePicker, } from '@material-ui/core';

const Oneway = () => {
	const [selectedDate, setSelectedDate] = React.useState(new Date('2014-08-18T21:11:54'));
	return (
	<Container>
		<Input placeholder="Select Origin" color="default"  variant="contained"/>
		<Input placeholder="Select Destination" />
		<KeyboardDatePicker
          margin="normal"
          id="date-picker-dialog"
          label="Date picker dialog"
          format="MM/dd/yyyy"
          value={selectedDate}
          onChange={handleDateChange}
          KeyboardButtonProps={{
            'aria-label': 'change date',
          }}
        />
		 <KeyboardDatePicker
          margin="normal"
          id="date-picker-dialog"
          label="Date picker dialog"
          format="MM/dd/yyyy"
          value={selectedDate}
          onChange={handleDateChange}
          KeyboardButtonProps={{
            'aria-label': 'change date',
          }}
        />
	</Container>
  )
}
export default Oneway ;
